import React from "react";
// import "./Header.css";
import {
  Stack,
  Button,
  AppBar,
  Toolbar,
  IconButton,
  Typography,
  Card,
  CardActions,
  Box,
  CardContent,
  CardHeader,
  Grid,
  Item,
} from "@mui/material";
import TaskAltIcon from "@mui/icons-material/TaskAlt";

class Header extends React.Component {
  render() {
    return (
      <>
        <AppBar position="static">
          <Toolbar>
            <IconButton size="large" edge="start" color="inherit">
              <TaskAltIcon></TaskAltIcon>
            </IconButton>
            <Typography
              variant="h6"
              component="div"
              sx={{ flexGrow: 1, textAlign: "left" }}
            >
              Task Manager
            </Typography>
          </Toolbar>
        </AppBar>

        <Grid>
          <Grid sx={{ alignContent: "center" }}>
            <Item>
              <Card
                raised="true"
                sx={{
                  width: 600,
                  maxHeight: 400,
                  mt: 20,
                  backgroundColor: "grey",
                }}
              >
                <CardHeader
                  avatar={<TaskAltIcon></TaskAltIcon>}
                  title="Create New Task"
                  sx={{ textAlign: "left" }}
                ></CardHeader>
                <CardContent></CardContent>
                <CardActions>
                  <Button size="small">Learn More</Button>
                </CardActions>
              </Card>
            </Item>
          </Grid>
        </Grid>
      </>
    );
  }
}

export default Header;
